def solve(arr):
    count = {}
    for element in arr:
        if element in count:
            count[element] += 1
        else:
            count[element] = 1

    for key, value in count.items():
        if value % 2 != 0:
            return key

def solve(arr):
    freq = {}
    for num in arr:
        freq[num] = freq.get(num, 0) + 1
    for key, value in freq.items():
        if value % 2 != 0:
            return key

